import React from "react";
import { Link } from "react-router-dom";
import "./Inicio.css";
import Homebtiinit from "../../assets/btinicio.png";

const App = (props) => {
  const checkoutHandler = () => {
    let url = 0;
    if ((url = 0)) {
      props.history.push("/select");
    }
  };

  return (
    <div className="App">
      <h1>
        Peça já <br /> sua Pizza!
      </h1>

      <Link className="initbtbg" onChange={checkoutHandler} to="/preferential">
        <img src={Homebtiinit} className="App-btn-strart" alt="logo" />
      </Link>

      <p className="IniciarP">Toque Para Iniciar</p>
    </div>
  );
};

export default App;
